svg.script:
window.onload = timer()
		function timer(){
			setInterval("setColor()",100)
		}

	      function setColor()
	      {
          var colo = document.getElementById("cs").style.fill;
          if(colo === 'rgb(138, 138, 138)') {
            document.getElementById("cs").style.fill = '#d4237a';
          } else {
            document.getElementById("cs").style.fill = '#8a8a8a';
          }

	      }
